import React, { Component } from 'react';
import './HeaderComponent.css';
import CardsComponent from './CardsComponent/CardsComponent';
import margotImgCard1 from './CardsComponent/imgCardsComponent/margotCard1.jpg';
import margotImgCard2 from './CardsComponent/imgCardsComponent/margotCard2.jpg';

const HeaderComponent= (props) => {
  return(

    <div className="App-header">
      <div className="headerComponent">
        <div className="titles">
          <p className="margotSignature">
            Margot Soria
          </p>
          <p className="margotBelowSignature">
            Chanteuse et Coach Vocale
          </p>
                       <div className="social">
                    <a className="external_links" id="youtube" rel="youtube" href="https://www.youtube.com/channel/UCwXBMbJ9gtmZiyWtt1zpO0w" title="YouTube" target="_blank"><i class="fab fa-youtube"></i></a>
                    <a className="external_links" id="instagram" rel="me" href="https://www.instagram.com/margotsoriart/" title="Instagram" target="_blank"><i class="fab fa-instagram"></i></a>
                    <a className="external_links email" id="email" rel="me" title="email" data-email="" href="mailto:"><i class="far fa-envelope"></i></a>
                 </div> 
          </div>
          <div className="margotHeadImg">
          <img src={props.logo} className="App-logo" alt="logo" />
          </div>
        </div>
<CardsComponent margotImgCard1={margotImgCard1} margotImgCard2={margotImgCard2}/>


      </div>





    )
};


export default HeaderComponent;
